Zócalo Public Square takes on ideas that enhance our understanding of community—the forces that strengthen or undermine human connectedness and social cohesion, through lectures, panels, screenings, and conferences. Zócalo is a neutral space for conversation and deliberation about the world today. Established in 2003, Zócalo has featured hundreds of thinkers and doers from a wide range of fields who explore how we see and relate to one another.&#xD;
&#xD;
KCRW has partnered with Zócalo Public Square to bring you this series of talks. KCRW does not endorse the content but presents it as a way to foster discussion and debate about life in Los Angeles.

Sonic Trace is a new story-telling project that begins in the heart of Los Angeles and crosses into Mexico, El Salvador, Guatemala and Honduras produced in partnership with KCRW. Sonic Trace stories are centered around three questions:&#xD;
&#xD;
¿Por qué te vas? (Why do you go?)&#xD;
¿Por qué te quedas? (Why do you stay?)&#xD;
¿Por qué regresas? (What makes you return?)&#xD;
&#xD;
The series is produced by Anayansi Diaz-Cortes and Eric Pearse-Chavez.  It is part of Localore, a nationwide initiative of AIR, the Association of Independents in Radio, and funded by CPB. Interactive design by Zeega.

