- Der Kirchliche Verein Radio Berner Oberland (KiBeO) will die Medienpräsenz der Kirchen im Sendegebiet von Radio BeO fördern und unterstützen.&#13;
&#13;
- Der Verein KiBeO hat zum Ziel, Kirchensendungen zu produzieren und zu veröffentlichen. Dazu hat der Verein Tontechniker und SendungsmacherInnen auf freiwilliger Basis rekrutiert und sorgt dafür, dass dieses Team mit Weiterbildungen immer auf dem neusten Stand ist.&#13;
&#13;
- Trägergruppe des Vereins sind alle drei Landeskirchen (reformiert, katholisch und christkatholisch) und fast alle Freikirchen des Berner Oberlandes, welche der Schweizerischen Evangelischen Allianz angehören. Die kirchlichen Informationen umfassen deshalb ein sehr breites Spektrum, der Verein KiBeO ist ein Stück gelebte Ökumene/Allianz.

