Susan Swartz is a journalist and author living in Sebastopol.  Her commentary can be heard every Friday on KRCB-FM Radio 91.1/90.9 and on www.krcb.org. &lt;br&gt;
&lt;br&gt; 
She appears every other week in the Sonoma West Times and News, Healdsburg Tribune and Windsor Times. You can also read her at www.juicytomatoes.com &lt;/br&gt;

The North Bay Report is a daily in-depth look at an issue, event, person or activity in our region, prepared by KRCB News Director Bruce Robinson, a veteran journalist who has been covering Sonoma County since 1985. &lt;br&gt;
&lt;br&gt;
These reports provide another view of news and events in our area, a way to look beyond the headlines and hear directly from the people who are shaping the present and future of Sonoma County and northern California. &lt;br&gt;
&lt;br&gt;
Topics recently covered on The North Bay Report include the regional real estate market, offshore oil drilling on the Sonoma Coast, school testing, local theater projects, homelessness, affordable health care, women&apos;s history, protecting the Tiger Salamander, and interviews with foreign exchange students, combating invasive weeds, the proposed Living Wage ordinance in Petaluma, grade school gardening projects, quarrels over gravel quarries in the west county, and election season political issues. &lt;br&gt;
&lt;br&gt;
The North Bay Report is heard Monday through Friday at 6:06 am and 8:06 am, repeating at 5:30 pm, on KRCB FM, 91.1 and 90.9 FM.  &lt;br&gt;

&quot;I like the vitality of in-studio, roundtable interviews,&quot; Gil says, &quot;when you have several authors sitting at the same table and focusing on the same theme, you get real conversations. It’s fun, exciting, and often unpredictable.&quot;  &lt;br&gt;
&lt;br&gt;
On the new Word by Word programs, Gil will be inviting a different guest each month to share their unique perspective on a &quot;Great California Writer.&quot; &lt;br&gt;
&lt;br&gt;
Gil Mansergh should be familiar to many KRCB listeners. His movie review columns appear in four Sonoma County newspapers, and his Cinema Toast radio show has been a Thursday morning staple on KRSH-FM for seven years. Author or Book Doctor of over 50 books, manuals and curriculums, Gil was honored as a Freelance Success by Writers Digest Magazine. He honed his interview skills during five years as Director of the prestigious California Writers Conference at Asilomar. &quot;I’m excited to have this opportunity to share my conversations with authors with KRCB’s listeners,&quot; Gil says, &quot;and I appreciate your comments.&quot; gilmansergh@comcast.net &lt;br&gt;&lt;br&gt;

WordTemple on KRCB features Northern California poet Katherine Hastings in discussion with poets and writers. The program showcases authors by presenting interviews and readings of their work, and exposes the KRCB community of listeners to a wide variety of voices and styles. Reconstructions highlighting the work of poets and writers posthumously will also be featured. From the Beats of San Francisco to Russia&apos;s Ratushinskaya, WordTemple will feature some of the most interesting work and stories in the world of literature. &lt;br&gt;
&lt;br&gt;
More information at wordtemple.com &lt;br&gt;

