Die neue Sendung mit der Maus oder wie Kulturwissenschaft die Welt erklärt: Ein Radio-Podcast des Instituts für Kulturwissenschaft der Humboldt-Universität zu Berlin.&#xD;
&#xD;
Unsere Beiträge befassen sich mit der europäischen Kulturgeschichte, -Soziologie, -Philosophie etc. Die Darstellung, Analyse und Interpretation von gesellschaftlichen Tatsachen und soziokulturellen Phänomenen soll im Zentrum der Beiträge stehen. Warum ist unsere moderne Gesellschaft so wie sie ist? Welche Zusammenhänge bestehen zwischen Menschenbild und technischem Fortschritt? Existiert eine Verbindung zwischen dem Bruttoinlandsprodukt eines Landes und dessen exzessivem Kaffeekonsum? Wie wirkt sich Social-Networking auf die zwischenmenschliche Kommunikation aus?&#xD;
&#xD;
Das Ziel der KulturWelle ist es, interdisziplinär zu arbeiten, Brücken zwischen den unterschiedlichen Fachbereichen zu schlagen sowie verschiedene Sichtweisen und Perspektiven auf kulturelle Phänomene kritisch und kontrovers zu diskutieren.&#xD;
&#xD;
Neben Studenten, Dozenten und Professoren kommen in den Beiträgen auch Künstler, Autoren und Musiker zu Wort. Über die Grenzen des universitären Bereichs hinaus versuchen wir interessierte Hörer zu gewinnen.

